import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { FaGithub, FaExternalLinkAlt, FaReact, FaNodeJs, FaPython, FaJs, FaHtml5, FaCss3Alt, FaCloud, FaBolt, FaRocket, FaKey, FaImage } from 'react-icons/fa';
import { SiDjango, SiMongodb, SiExpress } from 'react-icons/si';

const Projects = () => {
  const [selectedProject, setSelectedProject] = useState(null);
  const [currentIndex, setCurrentIndex] = useState(0);

  const projects = [
    {
      id: 1,
      title: "Help-Seek",
      role: "Backend Lead, Full-Stack Contributor",
      description: "Lost-and-found app with OTP verification, Cloudinary uploads, JWT auth, and real-time messaging",
      longDescription: "A comprehensive lost-and-found platform designed to help people recover their lost items through community support. Features secure authentication, real-time messaging, and media upload capabilities.",
      technologies: [
        { name: "React", icon: FaReact, color: "#61dafb" },
        { name: "JavaScript", icon: FaJs, color: "#f7df1e" },
        { name: "Node.js", icon: FaNodeJs, color: "#339933" },
        { name: "Express", icon: SiExpress, color: "#000000" },
        { name: "MongoDB", icon: SiMongodb, color: "#47a248" },
        { name: "JWT", icon: FaKey, color: "#000000" },
        { name: "Cloudinary", icon: FaImage, color: "#3448c5" }
      ],
      features: [
        "Complete backend architecture with REST APIs",
        "MongoDB schemas with optimized indexes and pagination",
        "Secure JWT authentication with email OTP verification",
        "Real-time notification system with debounced updates",
        "Cloudinary integration for secure media uploads",
        "Server-side validation and image optimization"
      ],
      liveUrl: "#",
      githubUrl: "#",
      image: "https://images.unsplash.com/photo-1551650975-87deedd944c3?w=800&h=600&fit=crop"
    },
    {
      id: 2,
      title: "Rock-Paper-Scissors Minus-1",
      role: "Full-Stack Developer, Real-Time Multiplayer",
      description: "Real-time multiplayer game with Django Channels and React",
      longDescription: "An innovative twist on the classic Rock-Paper-Scissors game featuring real-time multiplayer functionality with WebSocket communication and server-authoritative game logic.",
      technologies: [
        { name: "React", icon: FaReact, color: "#61dafb" },
        { name: "Python", icon: FaPython, color: "#3776ab" },
        { name: "Django", icon: SiDjango, color: "#092e20" },
        { name: "JavaScript", icon: FaJs, color: "#f7df1e" },
        { name: "WebSockets", icon: FaBolt, color: "#ff6b35" },
        { name: "Docker", icon: FaCloud, color: "#2496ed" }
      ],
      features: [
        "Real-time multiplayer using Django Channels WebSockets",
        "Lobby and matchmaking system with room creation",
        "Server-authoritative game logic preventing cheating",
        "Resilient WebSocket event handling with auto-reconnection",
        "Split-stack architecture deployment",
        "Docker containerization for scalable deployment"
      ],
      liveUrl: "#",
      githubUrl: "#",
      image: "https://images.unsplash.com/photo-1606092195730-5d7b9af1efc5?w=800&h=600&fit=crop"
    },
    {
      id: 3,
      title: "Forest Flow",
      role: "Pomodoro Timer Developer",
      description: "Pomodoro timer with Spotify integration and local persistence",
      longDescription: "A beautifully designed Pomodoro timer application that helps users maintain focus and productivity through structured work-break cycles with ambient music integration.",
      technologies: [
        { name: "JavaScript", icon: FaJs, color: "#f7df1e" },
        { name: "HTML", icon: FaHtml5, color: "#e34f26" },
        { name: "CSS", icon: FaCss3Alt, color: "#1572b6" },
        { name: "Spotify API", icon: FaRocket, color: "#1db954" }
      ],
      features: [
        "Configurable work/break intervals with auto-cycle progression",
        "Persistent user preferences via LocalStorage",
        "Spotify Embed integration for ambient focus music",
        "Responsive interface with visual progress indicators",
        "Keyboard controls for enhanced accessibility",
        "Cross-browser compatibility and smooth animations"
      ],
      liveUrl: "#",
      githubUrl: "#",
      image: "https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=800&h=600&fit=crop"
    }
  ];

  const nextProject = () => {
    setCurrentIndex((prev) => (prev + 1) % projects.length);
  };

  const prevProject = () => {
    setCurrentIndex((prev) => (prev - 1 + projects.length) % projects.length);
  };

  const openProjectModal = (project) => {
    setSelectedProject(project);
  };

  const closeProjectModal = () => {
    setSelectedProject(null);
  };

  return (
    <section id="projects" className="projects-section">
      <div className="container">
        <motion.h2
          className="section-title"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          Projects
        </motion.h2>

        <div className="projects-carousel">
          <div className="carousel-container">
            <motion.div
              className="carousel-track"
              animate={{ x: `-${currentIndex * 100}%` }}
              transition={{ duration: 0.5, ease: "easeInOut" }}
            >
              {projects.map((project, index) => (
                <motion.div
                  key={project.id}
                  className="project-card"
                  whileHover={{ 
                    scale: 1.05,
                    rotateY: 5,
                    z: 50
                  }}
                  whileTap={{ scale: 0.95 }}
                  onClick={() => openProjectModal(project)}
                  initial={{ opacity: 0, y: 50 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.6, delay: index * 0.2 }}
                  viewport={{ once: true }}
                >
                  <div className="project-image">
                    <img src={project.image} alt={project.title} />
                    <div className="project-overlay">
                      <div className="project-tech">
                        {project.technologies.slice(0, 4).map((tech, techIndex) => {
                          const TechIcon = tech.icon;
                          return (
                            <div key={techIndex} className="tech-icon">
                              <TechIcon size={20} style={{ color: tech.color }} />
                            </div>
                          );
                        })}
                      </div>
                    </div>
                  </div>

                  <div className="project-content">
                    <h3>{project.title}</h3>
                    <p className="project-role">{project.role}</p>
                    <p className="project-description">{project.description}</p>

                    <div className="project-actions">
                      <a href={project.liveUrl} className="btn btn-primary" target="_blank" rel="noopener noreferrer">
                        <FaExternalLinkAlt /> Live Demo
                      </a>
                      <a href={project.githubUrl} className="btn btn-secondary" target="_blank" rel="noopener noreferrer">
                        <FaGithub /> GitHub
                      </a>
                    </div>
                  </div>
                </motion.div>
              ))}
            </motion.div>
          </div>

          <div className="carousel-controls">
            <button className="control-btn prev" onClick={prevProject}>
              ←
            </button>
            <div className="carousel-indicators">
              {projects.map((_, index) => (
                <button
                  key={index}
                  className={`indicator ${index === currentIndex ? 'active' : ''}`}
                  onClick={() => setCurrentIndex(index)}
                />
              ))}
            </div>
            <button className="control-btn next" onClick={nextProject}>
              →
            </button>
          </div>
        </div>
      </div>

      <AnimatePresence>
        {selectedProject && (
          <motion.div
            className="project-modal"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            onClick={closeProjectModal}
          >
            <motion.div
              className="modal-content"
              initial={{ scale: 0.8, opacity: 0 }}
              animate={{ scale: 1, opacity: 1 }}
              exit={{ scale: 0.8, opacity: 0 }}
              onClick={(e) => e.stopPropagation()}
            >
              <button className="close-btn" onClick={closeProjectModal}>
                ×
              </button>

              <div className="modal-header">
                <h3>{selectedProject.title}</h3>
                <p className="modal-role">{selectedProject.role}</p>
              </div>

              <div className="modal-body">
                <div className="modal-image">
                  <img src={selectedProject.image} alt={selectedProject.title} />
                </div>

                <div className="modal-text">
                  <p className="modal-description">{selectedProject.longDescription}</p>

                  <div className="modal-features">
                    <h4>Key Features:</h4>
                    <ul>
                      {selectedProject.features.map((feature, index) => (
                        <li key={index}>{feature}</li>
                      ))}
                    </ul>
                  </div>

                  <div className="modal-tech">
                    <h4>Technologies Used:</h4>
                    <div className="tech-grid">
                      {selectedProject.technologies.map((tech, index) => {
                        const TechIcon = tech.icon;
                        return (
                          <div key={index} className="tech-item">
                            <TechIcon size={24} style={{ color: tech.color }} />
                            <span>{tech.name}</span>
                          </div>
                        );
                      })}
                    </div>
                  </div>
                </div>
              </div>

              <div className="modal-footer">
                <a href={selectedProject.liveUrl} className="btn btn-primary" target="_blank" rel="noopener noreferrer">
                  <FaExternalLinkAlt /> View Live Demo
                </a>
                <a href={selectedProject.githubUrl} className="btn btn-secondary" target="_blank" rel="noopener noreferrer">
                  <FaGithub /> View Source Code
                </a>
              </div>
            </motion.div>
          </motion.div>
        )}
      </AnimatePresence>

      <style jsx>{`
        .projects-section {
          min-height: 100vh;
          padding: 100px 0;
          background: ${theme === 'dark' ? '#242424' : '#EEEEEE'};
        }

        .section-title {
          text-align: center;
          font-size: 48px;
          font-weight: 700;
          margin-bottom: 80px;
          color: var(--text-light);
        }

        .projects-carousel {
          position: relative;
          max-width: 1200px;
          margin: 0 auto;
        }

        .carousel-container {
          overflow: hidden;
          border-radius: 20px;
          box-shadow: 0 20px 40px rgba(0, 0, 0, 0.3);
        }

        .carousel-track {
          display: flex;
          width: ${projects.length * 100}%;
        }

        .project-card {
          width: ${100 / projects.length}%;
          background: var(--secondary-dark);
          border-radius: 20px;
          overflow: hidden;
          cursor: pointer;
          transition: all 0.3s ease;
          margin: 0 10px;
          box-shadow: 0 10px 30px rgba(0, 0, 0, 0.2);
        }

        .project-image {
          position: relative;
          height: 300px;
          overflow: hidden;
        }

        .project-image img {
          width: 100%;
          height: 100%;
          object-fit: cover;
          transition: transform 0.3s ease;
        }

        .project-card:hover .project-image img {
          transform: scale(1.1);
        }

        .project-overlay {
          position: absolute;
          top: 0;
          left: 0;
          right: 0;
          bottom: 0;
          background: linear-gradient(45deg, rgba(37, 99, 235, 0.8), rgba(96, 165, 250, 0.6));
          opacity: 0;
          transition: opacity 0.3s ease;
          display: flex;
          align-items: center;
          justify-content: center;
        }

        .project-card:hover .project-overlay {
          opacity: 1;
        }

        .project-tech {
          display: flex;
          gap: 15px;
        }

        .tech-icon {
          background: rgba(255, 255, 255, 0.2);
          padding: 10px;
          border-radius: 50%;
          backdrop-filter: blur(10px);
        }

        .project-content {
          padding: 30px;
        }

        .project-content h3 {
          font-size: 24px;
          font-weight: 600;
          margin-bottom: 10px;
          color: var(--text-light);
        }

        .project-role {
          font-size: 14px;
          color: var(--accent-blue);
          font-weight: 500;
          margin-bottom: 15px;
        }

        .project-description {
          font-size: 16px;
          line-height: 1.6;
          color: var(--text-light);
          opacity: 0.8;
          margin-bottom: 25px;
        }

        .project-actions {
          display: flex;
          gap: 15px;
        }

        .project-actions .btn {
          flex: 1;
          display: flex;
          align-items: center;
          justify-content: center;
          gap: 8px;
          padding: 12px 20px;
          font-size: 14px;
        }

        .carousel-controls {
          display: flex;
          align-items: center;
          justify-content: space-between;
          margin-top: 40px;
        }

        .control-btn {
          width: 50px;
          height: 50px;
          border: none;
          border-radius: 50%;
          background: var(--accent-blue);
          color: white;
          font-size: 20px;
          cursor: pointer;
          transition: all 0.3s ease;
        }

        .control-btn:hover {
          background: #1d4ed8;
          transform: scale(1.1);
        }

        .carousel-indicators {
          display: flex;
          gap: 10px;
        }

        .indicator {
          width: 12px;
          height: 12px;
          border-radius: 50%;
          border: none;
          background: rgba(255, 255, 255, 0.3);
          cursor: pointer;
          transition: all 0.3s ease;
        }

        .indicator.active {
          background: var(--accent-blue);
          transform: scale(1.2);
        }

        .project-modal {
          position: fixed;
          top: 0;
          left: 0;
          right: 0;
          bottom: 0;
          background: rgba(0, 0, 0, 0.8);
          display: flex;
          align-items: center;
          justify-content: center;
          z-index: 1000;
          padding: 20px;
        }

        .modal-content {
          background: var(--secondary-dark);
          border-radius: 20px;
          max-width: 800px;
          width: 100%;
          max-height: 90vh;
          overflow-y: auto;
          position: relative;
        }

        .close-btn {
          position: absolute;
          top: 20px;
          right: 20px;
          width: 40px;
          height: 40px;
          border: none;
          border-radius: 50%;
          background: rgba(255, 255, 255, 0.1);
          color: var(--text-light);
          font-size: 24px;
          cursor: pointer;
          z-index: 10;
        }

        .modal-header {
          padding: 40px 40px 20px;
          text-align: center;
        }

        .modal-header h3 {
          font-size: 32px;
          font-weight: 600;
          margin-bottom: 10px;
          color: var(--text-light);
        }

        .modal-role {
          font-size: 16px;
          color: var(--accent-blue);
          font-weight: 500;
        }

        .modal-body {
          padding: 0 40px;
        }

        .modal-image {
          margin-bottom: 30px;
        }

        .modal-image img {
          width: 100%;
          height: 300px;
          object-fit: cover;
          border-radius: 12px;
        }

        .modal-description {
          font-size: 18px;
          line-height: 1.8;
          color: var(--text-light);
          margin-bottom: 30px;
        }

        .modal-features h4,
        .modal-tech h4 {
          font-size: 20px;
          font-weight: 600;
          margin-bottom: 15px;
          color: var(--text-light);
        }

        .modal-features ul {
          list-style: none;
          margin-bottom: 30px;
        }

        .modal-features li {
          padding: 8px 0;
          color: var(--text-light);
          opacity: 0.9;
          position: relative;
          padding-left: 20px;
        }

        .modal-features li::before {
          content: '✓';
          position: absolute;
          left: 0;
          color: var(--accent-blue);
          font-weight: bold;
        }

        .tech-grid {
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(120px, 1fr));
          gap: 15px;
          margin-bottom: 30px;
        }

        .tech-item {
          display: flex;
          align-items: center;
          gap: 10px;
          padding: 10px;
          background: rgba(37, 99, 235, 0.1);
          border-radius: 8px;
        }

        .tech-item span {
          font-size: 14px;
          color: var(--text-light);
        }

        .modal-footer {
          padding: 20px 40px 40px;
          display: flex;
          gap: 15px;
        }

        .modal-footer .btn {
          flex: 1;
          display: flex;
          align-items: center;
          justify-content: center;
          gap: 8px;
        }

        @media (max-width: 768px) {
          .projects-section {
            padding: 80px 0;
          }

          .section-title {
            font-size: 36px;
            margin-bottom: 60px;
          }

          .project-card {
            margin: 0 5px;
          }

          .project-content {
            padding: 20px;
          }

          .project-content h3 {
            font-size: 20px;
          }

          .project-description {
            font-size: 14px;
          }

          .project-actions {
            flex-direction: column;
          }

          .modal-content {
            margin: 10px;
          }

          .modal-header,
          .modal-body,
          .modal-footer {
            padding: 20px;
          }

          .modal-header h3 {
            font-size: 24px;
          }

          .modal-description {
            font-size: 16px;
          }

